var
  ii,n: longint;
  k,cnt: int64;
  a,b: array [0..55] of longint;

function rec1(i,j:longint):int64;
var
  v,cnt: int64;
begin
  cnt:=0;
  if i < j then
  begin
    a[i]:=1;
    a[j]:=0;
    if ((i > ii) or (a[i] = b[i])) and ((j > ii) or (a[j] = b[j])) then
      cnt:=cnt+rec1(i+1,j-1);
    a[i]:=0;
    a[j]:=1;
    if ((i > ii) or (a[i] = b[i])) and ((j > ii) or (a[j] = b[j])) then
      cnt:=cnt+rec1(i+1,j-1);
    a[i]:=0;
    a[j]:=0;
    if ((i > ii) or (a[i] = b[i])) and ((j > ii) or (a[j] = b[j])) then
    begin
      v:=j-i-1;
      if ii >= j-1 then v:=0 else
      if ii >= i+1 then v:=v-(ii-i);
      cnt:=cnt+(int64(1) shl v);
    end;
  end else
  begin
    if i = j then
    begin
      a[i]:=0;
      if (i > ii) or (a[i] = b[i]) then cnt:=1;
    end
    else cnt:=1;
  end;
  rec1:=cnt;
end;

function rec2(i,j:longint):int64;
var
  v,cnt: int64;
begin
  cnt:=0;
  if i < j then
  begin
    a[i]:=0;
    a[j]:=1;
    if ((i > ii) or (a[i] = b[i])) and ((j > ii) or (a[j] = b[j])) then
    begin
      v:=j-i-1;
      if ii >= j-1 then v:=0 else
      if ii >= i+1 then v:=v-(ii-i);
      cnt:=cnt+(int64(1) shl v);
    end;
    a[i]:=0;
    a[j]:=0;
    if ((i > ii) or (a[i] = b[i])) and ((j > ii) or (a[j] = b[j])) then
      cnt:=cnt+rec2(i+1,j-1);
    a[i]:=1;
    a[j]:=1;
    if ((i > ii) or (a[i] = b[i])) and ((j > ii) or (a[j] = b[j])) then
      cnt:=cnt+rec2(i+1,j-1);
  end else
  if i = j then
  begin
    if i <= ii then cnt:=1
    else cnt:=2;
  end
  else cnt:=1;
  rec2:=cnt;
end;

